insert  into `products`(`id`,`business_id`,`sku`,`image`,`name`,`name_ur`,`name_ru`,`type`,`category_id`,`unit_id`,`supplier_id`,`badge_id`,`account_id`,`purchase`,`purchased_qty`,`purchased_unit`,`sale`,`discount`,`dated`,`description`,`note`,`is_highlight`,`is_available`,`record_by`,`created_at`,`updated_at`) values (1,1,'SBZ00041','SBZ00041.jpg','Peas','مٹر','Matar',NULL,1,1,1,NULL,1,0,0,1,150,0,'1630395027','Peas are a good source of vitamins C and E, zinc, and other antioxidants that strengthen your immune system. Other nutrients, such as vitamins A and B and coumestrol, help reduce inflammation and lower your risk of chronic conditions, including diabetes, heart disease, and arthritis.',NULL,0,1,'1',NULL,'2021-08-31 12:30:27'),(2,1,'SBZ00040','SBZ00040.jpg','Onion Red','پیاز سرخ','Surukh Piyaz',NULL,1,1,1,1,1,0,0,1,50,0,'1630398406','The onion, also known as the bulb onion or common onion, is a vegetable that is the most widely cultivated species of the genus Allium. The shallot is a botanical variety of the onion. Until 2010, the shallot was classified as a separate species',NULL,1,1,'1',NULL,'2021-08-31 13:26:46'),(3,1,'SBZ00043','SBZ00043.jpg','Potato','آلو','Alu',NULL,1,1,1,2,1,0,0,1,45,0,'1630395125','Potatoes are a good source of fiber, which can help you lose weight by keeping you full longer. Fiber can help prevent heart disease by keeping cholesterol and blood sugar levels in check. Potatoes are also full of antioxidants that work to prevent diseases and vitamins that help your body function properly.',NULL,1,1,'1',NULL,'2021-08-31 12:32:05'),(4,1,'SBZ00055','SBZ00055.jpg','Tomato','ٹماٹر','Tamatar',NULL,1,1,1,6,1,0,0,1,70,0,'1630395140','Tomatoes are the major dietary source of the antioxidant lycopene, which has been linked to many health benefits, including reduced risk of heart disease and cancer. They are also a great source of vitamin C, potassium, folate, and vitamin K.',NULL,1,1,'1',NULL,'2021-08-31 12:32:20'),(5,1,'SBZ00019','SBZ00019.jpg','Cucumber','کھیرا','Khera',NULL,1,1,1,NULL,1,0,0,1,80,0,'1630395175','Cucumbers are rich in electrolytes. They can prevent dehydration and may support cardiovascular, bone, and skin health and help fight diabetes and cancer.',NULL,1,1,'1',NULL,'2021-08-31 12:32:55'),(6,1,'SBZ00027','SBZ00027.jpg','Green Chilli German','ہری مرچ','Hari Mirach',NULL,1,2,1,NULL,1,0,0,2,40,0,'1630397766','Chilies are known to be a rich source of antioxidants. Vitamins- A, B complex (B6 and B9), and C are found in abundance in green chilies. This compensates the damaging effects of bacteria in our bodies and is very helpful in preventing blood clots which is the primary reason for multiple cardiovascular diseases like heart stroke and cardiac arrest. Furthermore, helps in thwarting the spread of cancer to the colon, prostate, and lungs.',NULL,0,1,'1',NULL,'2021-08-31 13:16:06'),(7,1,'SBZ00025','SBZ00025.jpg','Ginger','ادرک','Adrak',NULL,1,2,1,NULL,1,0,0,2,130,0,'1630395366','Certain chemical compounds in fresh ginger help your body ward off germs. They’re especially good at halting growth of bacteria like E.coli and shigella, and they may also keep viruses like RSV at bay.',NULL,0,1,'1',NULL,'2021-08-31 12:36:06'),(8,1,'SBZ00028','SBZ00028.jpg','Green Coriander','ہرا دھنیا','Dhanya',NULL,1,3,1,NULL,1,0,0,3,20,0,'1630395426','Coriander or cilantro is a wonderful source of dietary fiber, manganese, iron and magnesium as well.\r\nIn addition, coriander leaves are rich in Vitamin C, Vitamin K and protein. They also contain small amounts of calcium, phosphorous, potassium, thiamin, niacin and carotene',NULL,1,1,'1',NULL,'2021-08-31 12:37:06'),(9,1,'SBZ00022','SBZ00022.jpg','Garlic China','لہسن چائنا','Lassan','China',1,2,1,NULL,1,0,0,2,90,0,'1630395518','Garlic (Allium sativum), is used widely as a flavoring in cooking, but it has also been used as a medicine throughout ancient and modern history; it has been taken to prevent and treat a wide range of conditions and diseases.',NULL,1,1,'1',NULL,