abetes risk. They can strengthen your bones. Carrots have calcium and vitamin K, both of which are important for bone health.',NULL,0,0,'1',NULL,'2021-08-31 12:47:50'),(16,1,'SBZ00015','SBZ00015.jpg','Cauliflower','گوبھی','Phool Gobi',NULL,1,1,1,2,1,0,0,1,100,0,'1630396123','Eating more plant foods, such as cauliflower, has been found to decrease the risk of obesity, diabetes, heart disease, and overall mortality while promoting a healthy complexion, increased energy, and overall lower weight.',NULL,1,1,'1',NULL,'2021-08-31 12:48:43'),(17,1,'SBZ00029','SBZ00029.jpg','Green Spring Onion','ہری پیاز','Hari Piyaz',NULL,1,2,1,NULL,1,0,0,2,40,0,'1630396143','Spring onions are rich in Vitamin C, Vitamin B2 and thiamine. Apart from that, they also contain Vitamin A and Vitamin K. They make good sources of elements like copper, phosphorous, magnesium, potassium, chromium, manganese and fibre.',NULL,0,1,'1',NULL,'2021-08-31 12:49:03'),(18,1,'SBZ00003','SBZ00003.jpg','Bitter gourd','کریلا','Karaily',NULL,1,1,1,NULL,1,0,0,1,100,0,'1630396163','Bitter gourd acts as a hypoglycemic agent. It is rich source of soluble fiber and is low in glycemic index, which helps in lowering the blood sugar level. It is an excellent source of dietary fiber. Regular consumption of bitter gourd contributes to relieving constipation and indigestion.',NULL,1,1,'1',NULL,'2021-08-31 12:49:23'),(19,1,'SBZ00036','SBZ00036.jpg','Green Lettuce Leaves','سلاد پتے','Salad ka Patty',NULL,1,2,1,NULL,1,0,0,2,50,0,'1630396235','Lettuce is particularly rich in antioxidants like vitamin C and other nutrients like vitamins A and K and potassium. This leafy green veggie helps fight inflammation and other related diseases like diabetes and cancer. The benefits only get better if you use the Romaine variety of lettuce, as not all lettuce is created equal. Also, the darker the lettuce, the more nutrient-dense it is.',NULL,0,1,'1',NULL,'2021-08-31 12:50:35'),(20,1,'SBZ00002','SBZ00002.jpg','Beetroot','چقندر','Chukandar',